import React from "react";
import { Link } from "react-router-dom";

import PropTypes from "prop-types";

import "./header.css";
import "./container_woman.css";

class ContainerWoman extends React.Component {
  render() {
    const {
      img_alt,
      img_src,
      img_classname,
      icon_alt,
      icon_src,
      icon_classname,
      description,
      link,
      name,
      link_classname,
    } = this.props;
    return (
      <div className="homepage-container-woman">
        <img alt={img_alt} src={img_src} className={img_classname} />
        <div className="homepage-container4 source">
          <img alt={icon_alt} src={icon_src} className={icon_classname} />
          <div className="target">
            <h1 className="homepage-text20 textXL">{name}</h1>
            <p className="homepage-text21">
              <span>{description}</span>
            </p>
            <a
              href={link}
              target="_blank"
              rel="noreferrer noopener"
              className={link_classname}
            >
              Learn more about her here!
            </a>
          </div>
        </div>
      </div>
    );
  }
}

export default ContainerWoman;
